import { GET_CURRENT_PLACE } from './../constants/types';

const initialState = {
    currentPlace: ''
}

export default function(state = initialState, action) {
    switch(action.type)
    {
        case GET_CURRENT_PLACE:
            return {
                ...state,
                currentPlace: action.payload
            }
        default:
            return state;
    }
}
